  true,\n\t\"url\": null,\n\t\"notes\": \"<p>U.S. Department of Health and Human Services
  (HHS). Centers for Disease Control and Prevention (CDC). Healthy People 2020 Tobacco
  Use Objectives. Healthy People 2020. Healthy People 2020 provides a framework for
  action to reduce tobacco use to the point that it is no longer a public health problem
  for the Nation. This dataset includes information related to the Healthy People
  2020 Tobacco Use objectives, operational definitions, baselines, and targets. Baseline
  years may vary by objective. Targets represented correspond to the year 2020.</p>n\",\n\t\"license_title\":
